// 모든 페이지들의 공통속성 처리
import React from 'react';
import PropTypes from 'prop-types';
import Head from 'next/head';
import 'antd/dist/antd.css'

const NodeBird = ({Component}) => {
    return (
        <>
            <div>공통 메뉴</div>
            <Component/>
        </>

    );
}

NodeBird.propTypes = {
    Component : PropTypes.elementType.isRequired,
}
export default NodeBird;
